usage:
```typescript
import { BlinkUp } from '@ionic-native/blinkup/ngx';

const options = <BlinkUpWifiOptions>{
   apiKey: 'API_KEY',
   timeoutMs: 60000,
   ssid: 'MY_SSID',
   password: 'MY_PASSWORD'
 }
 BlinkUp.flashWifiBlinkUp(options).subscribe(
    (result) => console.log('Done'),
    (error) => console.log(error)
  )
